	//parameter validations
	@Test
	public  void checkCanvasParamters() {
		Drawing draw = new Drawing();
		String testStr = "Invalid Parameters";
		
		String cmd1 = "C -1 -4";
		Assert.assertEquals(testStr, draw.run(cmd1));
		
		cmd1 = "C A -4";
		Assert.assertEquals(testStr, draw.run(cmd1));
		
		cmd1 = "C 3 4 2";
		Assert.assertEquals(testStr, draw.run(cmd1));
	}
	
